import React from "react"

class YaagDashboardList extends React.Component {
  render() {
    return (
      <div>
        {this.props.todos.map(todo => (
        
         <li>{todo.target}</li>
        ))}
      </div>
    )
  }
}

export default YaagDashboardList;
